import React from 'react';

function MyApplication() {
    return (
        <div>
            <h2>My Services</h2>
            <ul>
                <li>HR Hub</li>
                <li>Expense Hub</li>
                <li>Tool Manager</li>
                <li>Tickets</li>
            </ul>
        </div>
    );
}

export default MyApplication;
